"use client";
import React from "react";
import Link from "next/link";
import { usePathname } from "next/navigation";

interface NavLinkProps {
  href: string;
  children: React.ReactNode;
  activeClassName?: string;
  className?: string;
}

const NavLink: React.FC<NavLinkProps> = ({ href, children, activeClassName = "text-blue-600 font-bold", className = "" }) => {
  const pathname = usePathname();
  const isActive = pathname === href;
  return (
    <Link
      href={href}
      className={
        className + (isActive ? ` ${activeClassName}` : "")
      }
      aria-current={isActive ? "page" : undefined}
    >
      {children}
    </Link>
  );
};

export default NavLink;

"use client";
import React, { useState } from "react";

interface ResponsiveMenuProps {
  children: React.ReactNode;
}

const ResponsiveMenu: React.FC<ResponsiveMenuProps> = ({ children }) => {
  const [open, setOpen] = useState(false);

  return (
    <nav>
      {/* Desktop/Tablet */}
      <ul className="hidden md:flex flex-row gap-4 items-center">
        {children}
      </ul>
      {/* Mobile */}
      <div className="md:hidden flex items-center">
        <button
          aria-label="Open menu"
          onClick={() => setOpen(true)}
          className="p-2 focus:outline-none"
        >
          <span className="material-icons">menu</span>
        </button>
        {/* Overlay */}
        {open && (
          <div
            className="fixed inset-0 bg-black bg-opacity-40 z-40"
            onClick={() => setOpen(false)}
          />
        )}
        {/* Sliding Menu */}
        <div
          className={`fixed top-0 right-0 h-full w-64 bg-white z-50 shadow-lg transform transition-transform duration-300 ${open ? 'translate-x-0' : 'translate-x-full'}`}
        >
          <button
            aria-label="Close menu"
            onClick={() => setOpen(false)}
            className="p-4 focus:outline-none float-right"
          >
            <span className="material-icons">close</span>
          </button>
          <ul className="flex flex-col gap-4 mt-16 p-4">
            {children}
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default ResponsiveMenu;

